import React from "react";

import "./style.css"

const ServiceView = ( props ) =>{

    const { cartList } = props
    console.log( cartList )
    return (
        <div className="cart-box">
            <div className="cart-box-left">{cartList.sku}
                 <input id={cartList.cart_number} type="check"/>
                 <label for={`{cartList.cart_number}`}>
                    <img src="" alt=""/>
                 </label>
            </div>
            <div className="cart-box-right"></div>            
        </div>
    )
}

export default ServiceView
